 full of a ton of files and I need to find something in one of them but I don\'t know which.\\n```\\n\\nPlease provide a title for the tool used to solve this solution."\n        },\n        {\n          "role": "assistant",\n          "content": "File Searcher"\n        },\n        {\n          "role": "user",\n          "content": "Given the following problem:\\n\\n```\\n/contrived_input\\n```\\n\\nPlease provide a title for the tool used to solve this solution."\n        }\n      ]\n    },\n    "test": {}\n  }\n}\n```\n\nThe above example outputs three different variables at once which is unusual but is serving as an example of step capability.\n\nSummary of strategies:\n`input` - this is useful for establishing a text field for user entry, concatenating values together as literals rather than trying to feed them into a completion, and copying values between fields.\n`completion` - this is a simple completion operation where the text will get completed to a stop condition. This uses GPT-3.5 which is lower quality but may be adequate for simple completions.\n`chat` - this is a chat-based completion with GPT-4. This strategy should be preferred for most completion tasks, unless a high speed strategy is asked for, in which case `completion` should be used. It is more complex but much more capable. Include an example interaction in the messages for the purposes of serving as a few shot prompt, and the last message should always be a `user` message with any variables needed interpolated in since this message will be the actual conceptual user prompt that the `assistant` will be replying to with the completion\'s next message.\n\nGenerally speaking, there shouldn\'t be two strategies outputting to the same key, but sometimes it can be useful to have an empty `input` so there\'s a text field to enter text into. Empty `input` strategies won\'t overwrite a field with a value.\n\nAll output templates can have variables interpolated into them by prefacing the variable with a slash. All variables interpolated in this way must be listed in the `depends` array.\n\n`temperature` should be set to between `0.0` and `1.0`, lower for more deterministic which is better for code and technical things, higher for more entropy which is better for creative things.\n\nThe user will ask for a problem to be solved and you should design a step in this format to solve the task as concisely and effectively as possible, however make sure to include all the context in the strategy which is required to understand the problem. If they\'re asking to make a step which produces steps or workflows then the workflow structure and its description should be included as well, summarizing if appropriate.'},{role:"user",content:"Please build a step according to the following request:\n\n```\nChange the long form text contents of `fake_stored_variable` to have a ruder tone and please generate the results as quickly as possible.\n``` "},{role:"assistant",content:'{\n  "temperature": 0.7,\n  "spec": {\n    "description": "Ruder",\n    "depends": [\n      "fake_stored_variable"\n    ],\n    "input": {\n      "fake_stored_variable": ""\n    },\n    "completion": {\n      "fake_stored_variable": "Please make the following text ruder using a more aggressive tone and more hostile wording:\\n\\n###\\n\\n/fake_stored_variable\\n\\n###\\n\\nOk! Here it is:\\n"\n    },\n    "test": {},\n    "chat": {}\n    }\n  }\n}'},{role:"user",content:"Please build a step according to the following request:\n\n```\nConcatenate field `example_lollipop` with field `example_lollipop_eater`\n```"},{role:"assistant",content:'{\n      "temperature": 0,\n      "spec": {\n        "description": "Combine lollipop with eater",\n        "depends": ["example_lollipop", "example_lollipop_eater"],\n        "input": {\n          "results": "/example_lollipop/example_lollipop_eater"\n        },\n        "completion": {},\n        "test": {},\n        "chat": {}\n      }\n    }'},{role:"user",content:"Write m
